import { Container, BreadcrumbItem, Row, Col, Breadcrumb } from "shards-react";

// Layout
import Layout from "../components/Layout";

class Guide extends React.Component {
  render() {
    return (
      <Layout>
        <Container>
          <Breadcrumb>
            <BreadcrumbItem>
              <a href="/">Home</a>
            </BreadcrumbItem>

            <BreadcrumbItem active>Guides</BreadcrumbItem>
          </Breadcrumb>
          <p>This is Guides</p>
        </Container>
      </Layout>
    );
  }
}

export default Guide;
